class ShiftDetails extends Component {

    componentDidMount(){

    }

    render(){
   Reactotron.log('weatherData', this.props.weatherData)
        return (
                    <div> 
                        <div>
                    <div>
                        <DatePicker
                        dateChange={this.startDateChange}
                        value={this.state.startDate}
                    />
                    </div>
                    <div>
                        <DatePicker
                        dateChange={this.endDateChange}
                        value={this.state.endDate}
                    />
                    </div>
                    <form onSubmit={this.handleSubmit}>
                        <label>
                        temperature:
                        <input type="text" value={this.state.temperature} onChange={this.handleChange} />
                        </label>
                        <label>
                        speed:
                        <input type="text" value={this.state.temperature} onChange={this.handleChange} />
                        </label>
                        <input type="submit" value="Submit" />
                    </form>
                </div>
                {/* <TempForm /> */}
                <Button
                    variant="contained" 
                    color="primary"
                    value="Download"
                >
                   <CSVLink data={this.props.weatherData}>Download </CSVLink>
                </Button>
                <TempList weatherData={this.props.weatherData} />
            </div>
        )
    }
}

export default ShiftDetails;
